script: |
  super -f text -I q8616.spq | sort > q8616.out

inputs:
  - name: q8616.spq
    data: |
      SELECT DISTINCT - cor0.col2 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q8616.out
    data: |
      -54
      -57
      -96
